import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Modal from 'react-modal';

const TaskPage = () => {
    const [tasks, setTasks] = useState([]);
    const [modalIsOpen, setModalIsOpen] = useState(false);
    const [selectedTask, setSelectedTask] = useState(null);
    const [formData, setFormData] = useState({
        title: '',
        description: '',
        due_date: '',
        priority: '',
        status: '',
        creator_id: '',
        responsible_id: ''
    });

    useEffect(() => {
        fetchTasks();
    }, []);

    const fetchTasks = async () => {
        try {
            const response = await axios.get('http://localhost:8000/tasks');
            setTasks(response.data.tasks);
        } catch (error) {
            console.error('Failed to fetch tasks:', error);
        }
    };

    const openModal = (task) => {
        setSelectedTask(task);
        if (task) {
            setFormData({
                title: task.title,
                description: task.description,
                due_date: task.due_date,
                priority: task.priority,
                responsible: task.responsible,
                status: task.status
            });
        } else {
            setFormData({
                title: '',
                description: '',
                due_date: '',
                priority: '',
                responsible: '',
                status: ''
            });
        }
        setModalIsOpen(true);
    };

    const closeModal = () => {
        setSelectedTask(null);
        setModalIsOpen(false);
    };

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (selectedTask) {
                // Редактирование существующей задачи
                await axios.put(`http://localhost:8000/tasks/${selectedTask.id}`, formData);
            } else {
                // Создание новой задачи
                await axios.post('http://localhost:8000/tasks', formData);
            }
            closeModal();
            fetchTasks();
        } catch (error) {
            console.error('Failed to save task:', error);
        }
    };

    return (
        <div>
            <h2>Список задач</h2>
            {/* Отображение списка задач */}
            <button onClick={() => openModal(null)}>Новая задача</button>
            <Modal isOpen={modalIsOpen} onRequestClose={closeModal}>
                <h3>{selectedTask ? 'Редактирование задачи' : 'Создание новой задачи'}</h3>
                <form onSubmit={handleSubmit}>
                    <div>
                        <label>Заголовок:</label>
                        <input type="text" name="title" value={formData.title} onChange={handleChange} />
                    </div>
                    <div>
                        <label>Описание:</label>
                        <textarea name="description" value={formData.description} onChange={handleChange} />
                    </div>
                    <div>
                        <label>Дата завершения:</label>
                        <input type="date" name="due_date" value={formData.due_date} onChange={handleChange} />
                    </div>
                    <div>
                        <label>Приоритет:</label>
                        <select name="priority" value={formData.priority} onChange={handleChange}>
                            <option value="высокий">Высокий</option>
                            <option value="средний">Средний</option>
                            <option value="низкий">Низкий</option>
                        </select>
                    </div>
                    <div>
                        <label>Ответственный:</label>
                        <input type="text" name="responsible" value={formData.responsible} onChange={handleChange} />
                    </div>
                    <div>
                        <label>Статус:</label>
                        <select name="status" value={formData.status} onChange={handleChange}>
                            <option value="к выполнению">К выполнению</option>
                            <option value="выполняется">Выполняется</option>
                            <option value="выполнена">Выполнена</option>
                            <option value="отменена">Отменена</option>
                        </select>
                    </div>
                    <button type="submit">{selectedTask ? 'Сохранить изменения' : 'Создать задачу'}</button>
                </form>
                <button onClick={closeModal}>Закрыть</button>
            </Modal>
        </div>
    );
};

export default TaskPage;
